import React from 'react';

const Home = () => {
  return (
    <div>
      <section className="home">
        <div className="image"></div>
        <div className="text"></div>
      </section>
      <section className="users">
        <div className="image"></div>
        <div className="text"></div>
      </section>
      <section className="pair">
        <div className="image"></div>
        <div className="text"></div>
      </section>
      <section className="view">
        <div className="image"></div>
        <div className="text"></div>
      </section>
    </div>
  );
};

export default Home;
